-- Eliminar base de datos si existe
DROP DATABASE IF EXISTS petConnect;

-- Crear base de datos si no existe
CREATE DATABASE IF NOT EXISTS petConnect;

-- Usar base de datos
USE petConnect;


/****************************************************************************************
 * Crear tablas
 ****************************************************************************************/

/* ----------------  PAIS - CIUDAD  ----------------*/

-- Crear tabla pais
CREATE TABLE pais (
    paisId INT PRIMARY KEY,
    nombre VARCHAR(20) NOT NULL
);

-- Crear tabla ciudad
CREATE TABLE ciudad (
    ciudadId INT PRIMARY KEY,
    nombre VARCHAR(170) NOT NULL UNIQUE,
    paisId INT NOT NULL,
    FOREIGN KEY (paisId) REFERENCES pais(paisId)
);

/* ----------------  PROPIETARIO  ----------------*/

-- Crear tabla propietario
CREATE TABLE propietario (
    propietarioId INT PRIMARY KEY,
    primerNombre VARCHAR(20) NOT NULL,
    segundoNombre VARCHAR(20),
    primerApellido VARCHAR(20) NOT NULL,
    segundoApellido VARCHAR(20),
    genero VARCHAR(15) CHECK (genero IN ('Masculino', 'Femenino', 'No especificado')) NOT NULL,
    fechaNacimiento DATE NOT NULL,
    correo VARCHAR(50) NOT NULL UNIQUE,
    fechaRegistro DATE NOT NULL
);

/* ----------------  MASCOTA  ----------------*/

-- Crear tabla especie 
CREATE TABLE especie (
    especieId INT PRIMARY KEY,
    nombre VARCHAR(50) NOT NULL UNIQUE,
    descripcion VARCHAR(255) NOT NULL
);

-- Crear tabla mascota (perfil)
CREATE TABLE mascota (
    mascotaId INT PRIMARY KEY,
    nombre VARCHAR(50) NOT NULL,
    genero VARCHAR(15) CHECK (genero IN  ('Macho', 'Hembra', 'No especificado')) NOT NULL,
    fechaNacimiento DATE NOT NULL,
    propietarioId INT NOT NULL,
    especieId INT(50) NOT NULL,
    ciudadId INT NOT NULL,
    FOREIGN KEY (ciudadId) REFERENCES ciudad(ciudadId),
    FOREIGN KEY (especieId) REFERENCES especie(especieId),
    FOREIGN KEY (propietarioId) REFERENCES propietario(propietarioId)
);

-- Crear tabla privacidad
CREATE TABLE privacidad (
    privacidadId INT PRIMARY KEY,
    solicitudesAmistad VARCHAR(20) CHECK (solicitudesAmistad IN ('Cualquiera', 'Amigos de amigos', 'Nadie')) NOT NULL,
    privacidadPerfil VARCHAR(20) CHECK (privacidadPerfil IN ('Publico', 'Amigos de amigos', 'Privado')) NOT NULL,
    privacidadInformacion VARCHAR(20) CHECK (privacidadInformacion IN ('Publico', 'Amigos de amigos', 'Amigos', 'Privado')) NOT NULL,
    mascotaId INT NOT NULL UNIQUE,
    FOREIGN KEY (mascotaId) REFERENCES mascota(mascotaId)
);

-- Crear tabla intereses
CREATE TABLE interes (
    interesId INT PRIMARY KEY,
    interes VARCHAR(255) UNIQUE NOT NULL
);

-- Crear tabla interesesMascota
CREATE TABLE interesesMascota (
    interesesMascotaId INT PRIMARY KEY,
    mascotaId INT NOT NULL,
    interesId INT NOT NULL,
    FOREIGN KEY (mascotaId) REFERENCES mascota(mascotaId),
    FOREIGN KEY (interesId) REFERENCES interes(interesId),
    UNIQUE (mascotaId, interesId)
);

-- Crear tabla Amigos
CREATE TABLE amistad (
    amistadId INT PRIMARY KEY,
    mascota1Id INT,
    mascota2Id INT,
    estado VARCHAR(20) CHECK (estado IN ('Pendiente', 'Aceptada', 'Rechazada')) NOT NULL,
    FOREIGN KEY (mascota1Id) REFERENCES mascota(mascotaId),
    FOREIGN KEY (mascota2Id) REFERENCES mascota(mascotaId),
    CHECK (mascota1Id <> mascota2Id),
    UNIQUE (mascota1Id, mascota2Id)
);

-- Crear tabla SeguidoresMascota
CREATE TABLE seguidorMascota (
    seguidorMascotaId INT PRIMARY KEY,
    mascotaIdSeguido INT NOT NULL,
    mascotaIdSeguidor INT NOT NULL,
    FOREIGN KEY (mascotaIdSeguido) REFERENCES mascota(mascotaId),
    FOREIGN KEY (mascotaIdSeguidor) REFERENCES mascota(mascotaId),
    UNIQUE (mascotaIdSeguido, mascotaIdSeguidor)
);

-- Crear tabla Mensajes
CREATE TABLE mensajeMascota (
    mensajeId INT PRIMARY KEY,
    remitenteId INT NOT NULL,
    receptorId INT NOT NULL,
    mensajeTexto TEXT NOT NULL,
    fechaEnvio DATETIME,
    FOREIGN KEY (remitenteId) REFERENCES mascota(mascotaId),
    FOREIGN KEY (receptorId) REFERENCES mascota(mascotaId),
    UNIQUE (remitenteId, receptorId, fechaEnvio),
    CHECK (remitenteId <> receptorId)
);

-- Crear tabla PublicacionMascota
CREATE TABLE publicacionMascota (
    publicacionMascotaId INT PRIMARY KEY,
    mascotaId INT NOT NULL,
    descripcion TEXT NOT NULL,
    fechaPublicacion DATETIME NOT NULL,
    FOREIGN KEY (mascotaId) REFERENCES mascota(mascotaId)
);

-- Crear tabla multimediaMascota
CREATE TABLE multimediaMascota (
    multimediaMascotaId INT PRIMARY KEY,
    publicacionMascotaId INT NOT NULL,
    url TEXT NOT NULL, -- Puedes modificar esto para almacenar la URL de la multimedia
    FOREIGN KEY (publicacionMascotaId) REFERENCES publicacionMascota(publicacionMascotaId)
);

-- Crear tabla ReaccionPorMascota
CREATE TABLE reaccionPubicacionMascota (
    reaccionPubicacionMascotaId INT PRIMARY KEY,
    publicacionMascotaId INT NOT NULL,
    mascotaId INT NOT NULL,
    tipoReaccion VARCHAR(20) CHECK (tipoReaccion IN ('Me gusta', 'Me encanta', 'Me importa', 'Me divierte', 'Me asombra', 'Me entristece', 'Me enoja')) NOT NULL,
    fechaReaccion DATETIME NOT NULL,
    FOREIGN KEY (publicacionMascotaId) REFERENCES publicacionMascota(publicacionMascotaId),
    FOREIGN KEY (mascotaId) REFERENCES mascota(mascotaId),
    UNIQUE (publicacionMascotaId, mascotaId)
);

-- Crear tabla ComentariosMascota
CREATE TABLE comentarioPublicacionMascota (
    comentarioPublicacionMascotaId INT PRIMARY KEY,
    publicacionMascotaId INT NOT NULL,
    mascotaId INT NOT NULL,
    contenido TEXT NOT NULL,
    fechaComentario DATETIME NOT NULL,
    FOREIGN KEY (publicacionMascotaId) REFERENCES publicacionMascota(publicacionMascotaId),
    FOREIGN KEY (mascotaId) REFERENCES mascota(mascotaId)
);

-- Crear tabla DenunciasMascota
CREATE TABLE denunciaPublicacionMascota (
    denunciaPublicacionMascotaId INT PRIMARY KEY,
    publicacionMascotaId INT NOT NULL,
    mascotaId INT NOT NULL,
    motivo VARCHAR(30) CHECK (motivo IN ('Contenido inapropiado', 'Maltrato animal', 'Fraude', 'Otro')) NOT NULL,
    descripcion TEXT,
    fechaDenuncia DATETIME NOT NULL,
    FOREIGN KEY (publicacionMascotaId) REFERENCES publicacionMascota(publicacionMascotaId),
    FOREIGN KEY (mascotaId) REFERENCES mascota(mascotaId),
    UNIQUE (publicacionMascotaId, mascotaId)
);

/* ----------------  PAGINA  ----------------*/
-- Crear tabla pagina
CREATE TABLE pagina (
    paginaId INT PRIMARY KEY,
    nombre VARCHAR(255) NOT NULL UNIQUE,
    mascotaId INT NOT NULL,
    FOREIGN KEY (mascotaId) REFERENCES mascota(mascotaId)
);

-- Crear tabla PublicacionPagina
CREATE TABLE publicacionPagina (
    publicacionPaginaId INT PRIMARY KEY,
    paginaId INT NOT NULL,
    descripcion TEXT NOT NULL,
    fechaPublicacion DATETIME NOT NULL,
    FOREIGN KEY (paginaId) REFERENCES pagina(paginaId)
);

-- Crear tabla multimediaPagina
CREATE TABLE multimediaPagina (
    multimediaPaginaId INT PRIMARY KEY,
    publicacionPaginaId INT NOT NULL,
    url TEXT NOT NULL, -- Puedes modificar esto para almacenar la URL de la multimedia
    FOREIGN KEY (publicacionPaginaId) REFERENCES publicacionPagina(publicacionPaginaId)
);

-- Crear tabla ReaccionPublicacionPagina
CREATE TABLE reaccionPublicaionPagina (
    reaccionPublicaionPaginaId INT PRIMARY KEY,
    publicacionPaginaId INT NOT NULL,
    mascotaId INT NOT NULL,
    tipoReaccion VARCHAR(20) CHECK (tipoReaccion IN ('Me gusta', 'Me encanta', 'Me importa', 'Me divierte', 'Me asombra', 'Me entristece', 'Me enoja')) NOT NULL,
    fechaReaccion DATETIME NOT NULL,
    FOREIGN KEY (publicacionPaginaId) REFERENCES publicacionPagina(publicacionPaginaId),
    FOREIGN KEY (mascotaId) REFERENCES mascota(mascotaId),
    UNIQUE (publicacionPaginaId, mascotaId)
);

-- Crear tabla ComentariosPagina
CREATE TABLE comentarioPublicacionPagina (
    comentarioPublicacionPaginaId INT PRIMARY KEY,
    publicacionPaginaId INT NOT NULL,
    mascotaId INT NOT NULL,
    contenido TEXT NOT NULL,
    fechaComentario DATETIME NOT NULL,
    FOREIGN KEY (publicacionPaginaId) REFERENCES publicacionPagina(publicacionPaginaId),
    FOREIGN KEY (mascotaId) REFERENCES mascota(mascotaId)
);

-- Crear tabla DenunciasPagina
CREATE TABLE denunciaPublicacionPagina (
    denunciaPublicacionPaginaId INT PRIMARY KEY,
    publicacionPaginaId INT NOT NULL,
    mascotaId INT NOT NULL,
    motivo VARCHAR(30) CHECK (motivo IN ('Contenido inapropiado', 'Maltrato animal', 'Fraude', 'Otro')) NOT NULL,
    descripcion TEXT,
    fechaDenuncia DATETIME NOT NULL,
    FOREIGN KEY (publicacionPaginaId) REFERENCES publicacionPagina(publicacionPaginaId),
    FOREIGN KEY (mascotaId) REFERENCES mascota(mascotaId),
    UNIQUE (publicacionPaginaId, mascotaId)
);

  -- Crear tabla SeguidoresPagina
  CREATE TABLE seguidorPagina (
      seguidorPaginaId INT PRIMARY KEY,
      paginaId INT NOT NULL,
      mascotaId INT NOT NULL,
      FOREIGN KEY (paginaId) REFERENCES pagina(paginaId),
      FOREIGN KEY (mascotaId) REFERENCES mascota(mascotaId),
      UNIQUE (paginaId, mascotaId)
  );

-- Crear tabla evento mensajePagina
CREATE TABLE mensajePagina (
    mensajePaginaId INT PRIMARY KEY,
    paginaId INT NOT NULL,
    mascotaId INT NOT NULL,
    remitente VARCHAR(255) CHECK (remitente IN ('Mascota', 'Pagina')) NOT NULL,
    contenido TEXT NOT NULL,
    fechaEnvio DATETIME NOT NULL,
    FOREIGN KEY (paginaId) REFERENCES pagina(paginaId),
    FOREIGN KEY (mascotaId) REFERENCES mascota(mascotaId)
);

/* ----------------  Evento  ----------------*/
-- Crear tabla evento
CREATE TABLE evento (
    eventoId INT PRIMARY KEY,
    nombre VARCHAR(255) NOT NULL,
    descripcion TEXT NOT NULL,
    fechaInicio DATETIME NOT NULL,
    fechaFin DATETIME ,
    privacidad VARCHAR(20) CHECK (privacidad IN ('Publico', 'Amigos', 'Privado')) NOT NULL,
    ciudadId INT NOT NULL,
    mascotaId INT NOT NULL,
    FOREIGN KEY (ciudadId) REFERENCES ciudad(ciudadId),
    FOREIGN KEY (mascotaId) REFERENCES mascota(mascotaId),
    UNIQUE (nombre, ciudadId),
    CHECK (fechaInicio < fechaFin)
);

-- Crear tabla asistenciaEvento
CREATE TABLE asistenciaEvento (
    asistenciaEventoId INT PRIMARY KEY,
    estado VARCHAR(20) CHECK (estado IN ('Asistire', 'No asistire', 'Tal vez asista')) NOT NULL,
    mascotaId INT NOT NULL,
    eventoId INT NOT NULL,
    FOREIGN KEY (mascotaId) REFERENCES mascota(mascotaId),
    FOREIGN KEY (eventoId) REFERENCES evento(eventoId),
    UNIQUE (mascotaId, eventoId)
);

-- Crear tabla denunciaEvento
CREATE TABLE denunciaEvento (
    denunciaEventoId INT PRIMARY KEY,
    eventoId INT NOT NULL,
    mascotaId INT NOT NULL,
    motivo VARCHAR(30) CHECK (motivo IN ('Contenido inapropiado', 'Maltrato animal', 'Fraude', 'Otro')) NOT NULL,
    descripcion TEXT,
    fechaDenuncia DATETIME NOT NULL,
    FOREIGN KEY (eventoId) REFERENCES evento(eventoId),
    FOREIGN KEY (mascotaId) REFERENCES mascota(mascotaId),
    UNIQUE (eventoId, mascotaId)
);



/* ----------------  GRUPO  ----------------*/

-- Crear tabla grupo
CREATE TABLE grupo (
    grupoId INT PRIMARY KEY,
    nombre VARCHAR(255) NOT NULL,
    privacidad VARCHAR(20) CHECK (privacidad IN ('Publico', 'Privado')) NOT NULL,
    mascotaId INT NOT NULL,
    ciudadId INT NOT NULL,
    FOREIGN KEY (ciudadId) REFERENCES ciudad(ciudadId),
    FOREIGN KEY (mascotaId) REFERENCES mascota(mascotaId),
    UNIQUE (nombre, ciudadId)
);

-- Crear tabla MascotaGrupos (relación entre mascotas y grupos)
CREATE TABLE mascotaGrupo (
    mascotaGrupoId INT PRIMARY KEY,
    grupoId INT NOT NULL,
    mascotaId INT NOT NULL,
    FOREIGN KEY (mascotaId) REFERENCES mascota(mascotaId),
    FOREIGN KEY (grupoId) REFERENCES grupo(grupoId),
    UNIQUE (mascotaId, grupoId)
);

-- Crear tabla mensajeGrupo
CREATE TABLE mensajeGrupo (
    mensajeGrupoId INT PRIMARY KEY,
    mascotaGrupoId INT NOT NULL,
    contenido TEXT NOT NULL,
    fechaEnvio DATETIME NOT NULL,
    FOREIGN KEY (mascotaGrupoId) REFERENCES mascotaGrupo(mascotaGrupoId)
);

-- Crear tabla publicacionGrupo
CREATE TABLE publicacionGrupo (
    publicacionGrupoId INT PRIMARY KEY,
    mascotaGrupoId INT NOT NULL,
    descripcion TEXT NOT NULL,
    fechaPublicacion DATETIME NOT NULL,
    FOREIGN KEY (mascotaGrupoId) REFERENCES mascotaGrupo(mascotaGrupoId)
);

-- Crear tabla multimediaGrupo
CREATE TABLE multimediaGrupo (
    multimediaGrupoId INT PRIMARY KEY,
    publicacionGrupoId INT NOT NULL,
    url VARCHAR(255), -- Puedes modificar esto para almacenar la URL de la multimedia
    FOREIGN KEY (publicacionGrupoId) REFERENCES publicacionGrupo(publicacionGrupoId)
);

-- Crear reaccionPublicacionGrupo
CREATE TABLE reaccionPublicacionGrupo (
    reaccionPublicacionGrupoId INT PRIMARY KEY,
    publicacionGrupoId INT NOT NULL,
    mascotaId INT NOT NULL,
    tipoReaccion VARCHAR(20) CHECK (tipoReaccion IN ('Me gusta', 'Me encanta', 'Me importa', 'Me divierte', 'Me asombra', 'Me entristece', 'Me enoja')) NOT NULL,
    fechaReaccion DATETIME NOT NULL,
    FOREIGN KEY (publicacionGrupoId) REFERENCES publicacionGrupo(publicacionGrupoId),
    FOREIGN KEY (mascotaId) REFERENCES mascota(mascotaId),
    UNIQUE (publicacionGrupoId, mascotaId)
);

-- Crear comentarioPublicacionGrupo
CREATE TABLE comentarioPublicacionGrupo (
    comentarioPublicacionGrupoId INT PRIMARY KEY,
    publicacionGrupoId INT NOT NULL,
    mascotaId INT NOT NULL,
    contenido TEXT NOT NULL,
    fechaComentario DATETIME NOT NULL,
    FOREIGN KEY (publicacionGrupoId) REFERENCES publicacionGrupo(publicacionGrupoId),
    FOREIGN KEY (mascotaId) REFERENCES mascota(mascotaId)
);

-- Crear denunciaPublicacionGrupo
CREATE TABLE denunciaPublicacionGrupo (
    denunciaPublicacionGrupoId INT PRIMARY KEY,
    publicacionGrupoId INT NOT NULL,
    mascotaId INT NOT NULL,
    motivo VARCHAR(30) CHECK (motivo IN ('Contenido inapropiado', 'Maltrato animal', 'Fraude', 'Otro')) NOT NULL,
    descripcion TEXT,
    fechaDenuncia DATETIME NOT NULL,
    FOREIGN KEY (publicacionGrupoId) REFERENCES publicacionGrupo(publicacionGrupoId),
    FOREIGN KEY (mascotaId) REFERENCES mascota(mascotaId),
    UNIQUE (publicacionGrupoId, mascotaId)
);

/* ----------------  TIENDA  ----------------*/
-- Crear tabla categoria
CREATE TABLE categoria (
    categoriaId INT PRIMARY KEY,
    nombre VARCHAR(255) NOT NULL UNIQUE
);

-- Crear tabla tipoNegocio
CREATE TABLE tipoNegocio (
    tipoNegocioId INT PRIMARY KEY,
    nombre VARCHAR(255) NOT NULL UNIQUE
);

-- Crear tabla negocio
CREATE TABLE negocio (
    negocioId INT PRIMARY KEY,
    nombre VARCHAR(255) NOT NULL UNIQUE,
    ciudadId INT NOT NULL,
    tipoNegocioId INT NOT NULL,
    propietarioId INT,
    FOREIGN KEY (propietarioId) REFERENCES propietario(propietarioId),
    FOREIGN KEY (ciudadId) REFERENCES ciudad(ciudadId),
    FOREIGN KEY (tipoNegocioId) REFERENCES tipoNegocio(tipoNegocioId)
);

-- Crear tabla Producto
CREATE TABLE producto (
    productoId INT PRIMARY KEY,
    nombre VARCHAR(255) NOT NULL,
    especieId INT NOT NULL,
    categoriaId INT NOT NULL,
    FOREIGN KEY (especieId) REFERENCES especie(especieId),
    FOREIGN KEY (categoriaId) REFERENCES categoria(categoriaId)
);

-- Crear tabla productoEnVenta
CREATE TABLE productoEnVenta (
    productoEnVentaId INT PRIMARY KEY,
    productoId INT NOT NULL,
    precio DECIMAL(10, 2) NOT NULL,
    negocioId INT NOT NULL,
    cantidad INT NOT NULL,
    FOREIGN KEY (productoId) REFERENCES producto(productoId),
    FOREIGN KEY (negocioId) REFERENCES negocio(negocioId),
    UNIQUE (productoId, negocioId)
);

-- Crear tabla compraProducto
CREATE TABLE compraProducto (
    compraProductoId INT PRIMARY KEY,
    mascotaId INT NOT NULL,
    productoEnVentaId INT NOT NULL,
    cantidad INT NOT NULL,
    fechaCompra DATETIME NOT NULL,
    FOREIGN KEY (mascotaId) REFERENCES Mascota(mascotaId),
    FOREIGN KEY (productoEnVentaId) REFERENCES productoEnVenta(productoEnVentaId)
);


